// src/components/Apartments.js
import React, { useState } from "react";
import {
  Container,
  Box,
  List,
  ListItem,
  ListItemText,
  ListItemSecondaryAction,
  Typography,
  IconButton,
  Fab,
  Dialog,
  DialogContent,
  DialogTitle,
} from "@mui/material";
import { pxToRem } from "../../utils/pxToRem";
import ArrowForwardIosIcon from "@mui/icons-material/ArrowForwardIos";
import { useTheme } from "@mui/material/styles";
import AddIcon from "@mui/icons-material/Add";
import ApartmentDetail from "./ApartmentDetail"; // Importa il componente ApartmentDetail

const apartments = [
  {
    id: 1,
    name: "Appartamento A",
    location: "Roma",
    period: "7gg da 5 lug",
    status: "expired",
  },
  {
    id: 2,
    name: "Appartamento B",
    location: "Milano",
    period: "14 al 18 sett.",
    status: "active",
  },
  {
    id: 3,
    name: "Appartamento C",
    location: "Firenze",
    period: "-",
    status: "inactive",
  },
];

const Apartments = () => {
  const theme = useTheme();
  const [open, setOpen] = useState(false); // Stato per la modale

  // Funzione per aprire la modale per aggiungere o modificare un appartamento
  const handleClickOpen = (apartment = null) => {
    setSelectedApartment(apartment);
    setOpen(true);
  };

  // Funzione per chiudere la modale
  const handleClose = () => {
    setOpen(false);
    setSelectedApartment(null);
  };

  return (
    <Container component="main" maxWidth="sm" sx={{ position: "relative" }}>
      <Box
        sx={{
          marginTop: pxToRem(32),
          display: "flex",
          flexDirection: "column",
          alignItems: "center",
          padding: pxToRem(20),
          borderRadius: pxToRem(8),
          boxShadow: `0px ${pxToRem(0)} ${pxToRem(10)} #635FC7`,
        }}>
        <Typography
          component="h1"
          variant="h4"
          sx={{ marginBottom: pxToRem(24) }}>
          Appartamenti
        </Typography>
        <List sx={{ width: "100%" }}>
          {apartments.map((apartment) => (
            <ListItem
              key={apartment.id}
              sx={{
                borderBottom: `1px solid ${theme.palette.divider}`,
                display: "flex",
                alignItems: "center",
              }}>
              <Box
                sx={{
                  width: pxToRem(40),
                  height: pxToRem(40),
                  backgroundColor: theme.palette.background.default,
                  borderRadius: "50%",
                  marginRight: pxToRem(10),
                }}
              />
              <ListItemText
                primary={<Typography variant="h6">{apartment.name}</Typography>}
                secondary={
                  <Typography
                    variant="body2"
                    sx={{ color: theme.palette.text.secondary }}>
                    Periodo: {apartment.period}
                  </Typography>
                }
              />
              <Typography
                variant="body2"
                sx={{
                  color: theme.palette.error.main,
                  fontWeight: "bold",
                  marginRight: pxToRem(10),
                }}>
                {apartment.status.toUpperCase()}
              </Typography>
              <ListItemSecondaryAction>
                <IconButton
                  edge="end"
                  onClick={() => handleClickOpen(apartment)}>
                  <ArrowForwardIosIcon />
                </IconButton>
              </ListItemSecondaryAction>
            </ListItem>
          ))}
        </List>
      </Box>
      <Fab
        color="primary"
        aria-label="add"
        sx={{
          position: "fixed",
          bottom: pxToRem(30),
          right: pxToRem(30),
        }}
        onClick={() => handleClickOpen()} // Apre la modale per aggiungere un nuovo appartamento
      >
        <AddIcon />
      </Fab>

      {/* Modale per l'aggiunta o la modifica di un appartamento */}
      <Dialog open={open} onClose={handleClose}>
        <DialogContent>
          <ApartmentDetail onSave={handleClose} />
        </DialogContent>
      </Dialog>
    </Container>
  );
};

export default Apartments;
